import './Map.css';
import { MapContainer} from 'react-leaflet';
import Layers from './Layers';



function Map() {

  return (
    <div className="Map">
      <MapContainer center={[52.52437, 13.41053]} zoom={13}>
        <LayersControl position="topright" collapsed="False">
        <Layers />
        </LayersControl>
      </MapContainer>
    </div>
  );
}

export default Map;
